import React from "react";

const TableBody = (props) => {
  return (
    <tr>
      <td>{props.firstName}</td>
      <td>{props.lastName}</td>
      <td>{props.email}</td>
      <td>{props.phone}</td>
      <td>{props.picture}</td>
    </tr>
  );
};

export default TableBody;
